INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1001, "2030/12/31 15:00:00", "", "bgm_M199_juke", "お兄ちゃん争奪！\nどっちのチョコがおいしいでSHOW", "2030/12/31 15:00:00", 1002, 10000, "2020-02-15 15:00:00", "bgm_M199", "愛情たっぷりのチョコレートケー\nキを完成させよう！\n超キュートなタップゲーム！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1002, "2030/12/31 15:00:00", "", "bgm_M227_juke", "クウカ大回転\n飛行道中エクスタシー", "2030/12/31 15:00:00", 1003, 10000, "2020-02-15 15:00:00", "bgm_M227", "大回転！クウカ！\n最高のエクスタシーここにあり！\n引っ張って飛ばす、空の旅！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1003, "2030/12/31 15:00:00", "", "bgm_M249_juke", "カオリのマブイ式空手道場", "2030/12/31 15:00:00", 1004, 10000, "2020-02-15 15:00:00", "bgm_M249", "これぞ琉球魂！\n押し寄せるマジムンをなぎ倒す\n爽快アクションゲーム！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1004, "2030/12/31 15:00:00", "", "bgm_M277_juke", "大激戦！しりとりドラゴンズ", "2030/12/31 15:00:00", 1005, 10000, "2020-02-15 15:00:00", "bgm_M277", "白熱バトル！\nドラゴンズネスト流\nタイマン式頭脳しりとり！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1005, "2030/12/31 15:00:00", "", "bgm_M355_Lofi_juke", "チュウチュウパニック！\nチーズお守り大作戦！", "2030/12/31 15:00:00", 1006, 10000, "2020-05-31 12:00:00", "bgm_M355_Lofi", "キミはチーズを守り抜けるか！？\n瞬発力が試される\n反射神経系カジュアルゲーム！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1006, "2030/12/31 15:00:00", "", "bgm_M399", "猛訓打撃道！\nミサトのホームランドリル", "2030/12/31 15:00:00", 1007, 10000, "2020-08-15 15:00:00", "bgm_M399", "目指せホームランバッター！\nミートタイミングがカギを握る\nスポーツアクションゲーム！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1007, "2030/12/31 15:00:00", "", "bgm_M500", "カルミナサマーライブ\nライブ会場 グッズエリア", "2030/12/31 15:00:00", 1008, 10000, "2021-08-31 12:00:00", "bgm_M500", "カルミナファン大興奮！\nライブ応援グッズを手に入れて\n目指せ「カルミナ神推し」！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1008, "2030/12/31 15:00:00", "", "bgm_M540", "ミヤコ's キッチン　究極への道", "2030/12/31 15:00:00", 1009, 10000, "2021-12-18 15:00:00", "bgm_M540", "レッツ・クッキング！\nミヤコとプリンを作って食べて\nプリンの道を極めよう！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1009, "2022/02/28 11:59:59", "ランドソルクイズコネクト！", "bgm_M569", "Happy Anniv.スペシャル　\nランドソルクイズコネクト！", "2022/02/15 15:00:00", 1010, 0, "2022-02-15 15:00:00", "bgm_M569", "５人チームで力を合わせて多種多\n様なジャンルのクイズに挑戦！\n目指せ、クイズプリンセス！");
