INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1012, "2030/12/31 15:00:00", "放課後クイズエデュケーション　{0}", "bgm_MC068", "キャルとスズナの\n放課後クイズエデュケーション", "2030/12/31 15:00:00", 1012, 10000, "2023-09-18 15:00:00", "bgm_MC068", "めざせ全問正解！\nキャルとスズナと放課後の教室で\n二人きりのクイズ勉強会！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1013, "2030/12/31 15:00:00", "行軍（マーチ）A-Go-Go！", "bgm_MC141", "エリコとマコトの\n行軍（マーチ）A-Go-Go！", "2030/12/31 15:00:00", 1013, 10000, "2024-04-18 15:00:00", "bgm_MC141", "魔物はびこる街道を突き進め！\n【王宮騎士団(NIGHTMARE)】\nの兵たちを率い、訓練に挑戦だ！");
INSERT INTO `v1_ff8b3c0fc7127ab2656283af1031ce412ec2d5a24fe5e08b39aed0e7ad2ebc49` VALUES (1014, "2030/12/31 15:00:00", "激突！破壊！\nイリーガルタンクウォー", "bgm_MC199_Battle", "激突！破壊！\nイリーガルタンクウォー", "2030/12/31 15:00:00", 1014, 10000, "2024-11-18 15:00:00", "bgm_MC199", "戦車バトル大会開幕！\n組み上げたオリジナルマシンで\n頂点を目指せ！");
